import React from 'react'; 
// import Greating from './Greating';
import * as ques from './Cal';
 
function App(){

return <> 
 <h3> sum{ ques.sum}/</h3>
 <h3>{ ques.sub}/</h3>
 <h3>{ ques.mul}/</h3>
 <h3>{ ques.dev}</h3>


</>;
 


}
export default App;
